import React, { useEffect, useState } from "react";

const Fish = () => {
  const [fiszka, setFiszka] = useState([]);

  const getAllUser = async () => {
    const response = await fetch("http://127.0.0.1:8000/api/fiszki/");
    response.json().then((res) => setFiszka(res.data.fiszka));
    console.log(fiszka);
  };

  useEffect(() => {
    getAllUser();
  }, []);

  return (
    <>
      {fiszka.map((ce) => (
        <div key={ce.id}>
          <h2>{ce.text}</h2>
          <p>{ce.reverse}</p>
        </div>
      ))}
    </>
  );
};

export default Fish;
